import '../styles/ItemCard.css';

function ItemCard({image,index,name,price}) {
  return (
    <div className="ItemCard">
            <img src={image} alt={`${index} product`} />
            <p>{name}</p>
            <span>{price}</span>

        </div>
  )
}

export default ItemCard
